"use strict";

////////////////CAROUSEL HOME PAGE START //////////////////////////
function nextSlide() {
  var slide = document.querySelectorAll('.cont-img');
  var nbSlides = slide.length;
  var count = 0;
  slide[count].classList.remove('active');

  if (count < nbSlides - 1) {
    count++;
  } else {
    count = 0;
  }

  slide[count].classList.add('active');
}

setInterval(nextSlide, 6000); ////////////////CAROUSEL HOME PAGE END //////////////////////////
